import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import { Link } from "react-router-dom";
import './home.scss';
import carImage from '../../images/home/pink-lambo.png';
const Home = () => {
    return (
      <div className="designPattern py-4">
          <div className='designPatternInner'>
          <img className="img-gluid designImage"  src={carImage}/>

          </div>
      </div>
    )
}

export default Home
